Name: 'Cat' // My.Cat.speciesName = 'Cat'\n    },\n\n    constructor: function() {\n        alert(this.self.speciesName); // dependent on 'this'\n    },\n\n    clone: function() {\n        return new this.self();\n    }\n});\n\n\n<a href=\"#!/api/Ext-method-define\" rel=\"Ext-method-define\" cl***REMOVED***=\"docCl***REMOVED***\">Ext.define</a>('My.SnowLeopard', {\n    extend: 'My.Cat',\n    statics: {\n        speciesName: 'Snow Leopard'         // My.SnowLeopard.speciesName = 'Snow Leopard'\n    }\n});\n\nvar cat = new My.Cat();                     // alerts 'Cat'\nvar snowLeopard = new My.SnowLeopard();     // alerts 'Snow Leopard'\n\nvar clone = snowLeopard.clone();\nalert(<a href=\"#!/api/Ext-method-getCl***REMOVED***Name\" rel=\"Ext-method-getCl***REMOVED***Name\" cl***REMOVED***=\"docCl***REMOVED***\">Ext.getCl***REMOVED***Name</a>(clone));             // alerts 'My.SnowLeopard'\n</code></pre>\n</div></div></div></div><div cl***REMOVED***='subsection'><div cl***REMOVED***='definedBy'>Defined By</div><h4 cl***REMOVED***='members-subtitle'>Static Properties</h3><div id='static-property-S-onExtended' cl***REMOVED***='member first-child inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' cl***REMOVED***='defined-in docCl***REMOVED***'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-static-property-S-onExtended' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Ext.Base-static-property-S-onExtended' cl***REMOVED***='name expandable'>$onExtended</a><span> : <a href=\"#!/api/Array\" rel=\"Array\" cl***REMOVED***=\"docCl***REMOVED***\">Array</a></span><strong cl***REMOVED***='private signature'>private</strong><strong cl***REMOVED***='static signature'>static</strong></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'> ...</div><div cl***REMOVED***='long'>\n<p>Defaults to: <code>[]</code></p></div></div></div></div></div><div cl***REMOVED***='members-section'><h3 cl***REMOVED***='members-title icon-method'>Methods</h3><div cl***REMOVED***='subsection'><div cl***REMOVED***='definedBy'>Defined By</div><h4 cl***REMOVED***='members-subtitle'>Instance Methods</h3><div id='method-constructor' cl***REMOVED***='member first-child inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><a href='#!/api/Ext.chart.axis.Abstract' rel='Ext.chart.axis.Abstract' cl***REMOVED***='defined-in docCl***REMOVED***'>Ext.chart.axis.Abstract</a><br/><a href='source/Abstract.html#Ext-chart-axis-Abstract-method-constructor' target='_blank' cl***REMOVED***='view-source'>view source</a></div><strong cl***REMOVED***='new-keyword'>new</strong><a href='#!/api/Ext.chart.axis.Abstract-method-constructor' cl***REMOVED***='name expandable'>Ext.chart.axis.Numeric</a>( <span cl***REMOVED***='pre'>[<a href=\"#!/api/Object\" rel=\"Object\" cl***REMOVED***=\"docCl***REMOVED***\">Object</a> config]</span> ) : <a href=\"#!/api/Object\" rel=\"Object\" cl***REMOVED***=\"docCl***REMOVED***\">Object</a></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Creates new Axis. ...</div><div cl***REMOVED***='long'><p>Creates new Axis.</p>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>config</span> : <a href=\"#!/api/Object\" rel=\"Object\" cl***REMOVED***=\"docCl***REMOVED***\">Object</a> (optional)<div cl***REMOVED***='sub-desc'><p>Config options.</p>\n</div></li></ul><h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Object\" rel=\"Object\" cl***REMOVED***=\"docCl***REMOVED***\">Object</a></span><div cl***REMOVED***='sub-desc'>\n</div></li></ul></div></div></div><div id='method-callOverridden' cl***REMOVED***='member  inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' cl***REMOVED***='defined-in docCl***REMOVED***'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-method-callOverridden' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Ext.Base-method-callOverridden' cl***REMOVED***='name expandable'>callOverridden</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/Array\" rel=\"Array\" cl***REMOVED***=\"docCl***REMOVED***\">Array</a>/Arguments args</span> ) : <a href=\"#!/api/Object\" rel=\"Object\" cl***REMOVED***=\"docCl***REMOVED***\">Object</a><strong cl***REMOVED***='deprecated signature'>deprecated</strong><strong cl***REMOVED***='protected signature'>protected</strong></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Call the original method that was previously overridden with override\n\nExt.define('My.Cat', {\n    constructor: functi...</div><div cl***REMOVED***='long'><p>Call the original method that was previously overridden with <a href=\"#!/api/Ext.Base-static-method-override\" rel=\"Ext.Base-static-method-override\" cl***REMOVED***=\"docCl***REMOVED***\">override</a></p>\n\n<pre><code><a href=\"#!/api/Ext-method-define\" rel=\"Ext-method-define\" cl***REMOVED***=\"docCl***REMOVED***\">Ext.define</a>('My.Cat', {\n    constructor: function() {\n        alert(\"I'm a cat!\");\n    }\n});\n\nMy.Cat.override({\n    constructor: function() {\n        alert(\"I'm going to be a cat!\");\n\n        this.callOverridden();\n\n        alert(\"Meeeeoooowwww\");\n    }\n});\n\nvar kitty = new My.Cat(); // alerts \"I'm going to be a cat!\"\n                          // alerts \"I'm a cat!\"\n                          // alerts \"Meeeeoooowwww\"\n</code></pre>\n        <div cl***REMOVED***='signature-box deprecated'>\n        <p>This method has been <strong>deprecated</strong> </p>\n        <p>as of 4.1. Use <a href=\"#!/api/Ext.Base-method-callParent\" rel=\"Ext.Base-method-callParent\" cl***REMOVED***=\"docCl***REMOVED***\">callParent</a> instead.</p>\n\n        </div>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>args</span> : <a href=\"#!/api/Array\" rel=\"Array\" cl***REMOVED***=\"docCl***REMOVED***\">Array</a>/Arguments<div cl***REMOVED***='sub-desc'><p>The arguments, either an array or the <code>arguments</code> object\nfrom the current method, for example: <code>this.callOverridden(arguments)</code></p>\n</div></li></ul><h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Object\" rel=\"Object\" cl***REMOVED***=\"docCl***REMOVED***\">Object</a></span><div cl***REMOVED***='sub-desc'><p>Returns the result of calling the overridden method</p>\n</div></li></ul></div></div></div><div id='method-callParent' cl***REMOVED***='member  inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' cl***REMOVED***='defined-in docCl***REMOVED***'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-method-callParent' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Ext.Base-method-callParent' cl***REMOVED***='name expandable'>callParent</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/Array\" rel=\"Array\" cl***REMOVED***=\"docCl***REMOVED***\">Array</a>/Arguments args</span> ) : <a href=\"#!/api/Object\" rel=\"Object\" cl***REMOVED***=\"docCl***REMOVED***\">Object</a><strong cl***REMOVED***='protected signature'>protected</strong></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'>Call the \"parent\" method of the current method. ...</div><div cl***REMOVED***='long'><p>Call the \"parent\" method of the current method. That is the method previously\noverridden by derivation or by an override (see <a href=\"#!/api/Ext-method-define\" rel=\"Ext-method-define\" cl***REMOVED***=\"docCl***REMOVED***\">Ext.define</a>).</p>\n\n<pre><code> <a href=\"#!/api/Ext-method-define\" rel=\"Ext-method-define\" cl***REMOVED***=\"docCl***REMOVED***\">Ext.define</a>('My.Base', {\n     constructor: function (x) {\n         this.x = x;\n     },\n\n     statics: {\n         method: function (x) {\n             return x;\n         }\n     }\n });\n\n <a href=\"#!/api/Ext-method-define\" rel=\"Ext-method-define\" cl***REMOVED***=\"docCl***REMOVED***\">Ext.define</a>('My.Derived', {\n     extend: 'My.Base',\n\n     constructor: function () {\n         this.callParent([21]);\n     }\n });\n\n var obj = new My.Derived();\n\n alert(obj.x);  // alerts 21\n</code></pre>\n\n<p>This can be used with an override as follows:</p>\n\n<pre><code> <a href=\"#!/api/Ext-method-define\" rel=\"Ext-method-define\" cl***REMOVED***=\"docCl***REMOVED***\">Ext.define</a>('My.DerivedOverride', {\n     override: 'My.Derived',\n\n     constructor: function (x) {\n         this.callParent([x*2]); // calls original My.Derived constructor\n     }\n });\n\n var obj = new My.Derived();\n\n alert(obj.x);  // now alerts 42\n</code></pre>\n\n<p>This also works with static methods.</p>\n\n<pre><code> <a href=\"#!/api/Ext-method-define\" rel=\"Ext-method-define\" cl***REMOVED***=\"docCl***REMOVED***\">Ext.define</a>('My.Derived2', {\n     extend: 'My.Base',\n\n     statics: {\n         method: function (x) {\n             return this.callParent([x*2]); // calls My.Base.method\n         }\n     }\n });\n\n alert(My.Base.method(10);     // alerts 10\n alert(My.Derived2.method(10); // alerts 20\n</code></pre>\n\n<p>Lastly, it also works with overridden static methods.</p>\n\n<pre><code> <a href=\"#!/api/Ext-method-define\" rel=\"Ext-method-define\" cl***REMOVED***=\"docCl***REMOVED***\">Ext.define</a>('My.Derived2Override', {\n     override: 'My.Derived2',\n\n     statics: {\n         method: function (x) {\n             return this.callParent([x*2]); // calls My.Derived2.method\n         }\n     }\n });\n\n alert(My.Derived2.method(10); // now alerts 40\n</code></pre>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>args</span> : <a href=\"#!/api/Array\" rel=\"Array\" cl***REMOVED***=\"docCl***REMOVED***\">Array</a>/Arguments<div cl***REMOVED***='sub-desc'><p>The arguments, either an array or the <code>arguments</code> object\nfrom the current method, for example: <code>this.callParent(arguments)</code></p>\n</div></li></ul><h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Object\" rel=\"Object\" cl***REMOVED***=\"docCl***REMOVED***\">Object</a></span><div cl***REMOVED***='sub-desc'><p>Returns the result of calling the parent method</p>\n</div></li></ul></div></div></div><div id='method-configCl***REMOVED***' cl***REMOVED***='member  inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' cl***REMOVED***='defined-in docCl***REMOVED***'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-method-configCl***REMOVED***' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Ext.Base-method-configCl***REMOVED***' cl***REMOVED***='name expandable'>configCl***REMOVED***</a>( <span cl***REMOVED***='pre'></span> )<strong cl***REMOVED***='private signature'>private</strong></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'> ...</div><div cl***REMOVED***='long'>\n</div></div></div><div id='method-destroy' cl***REMOVED***='member  inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' cl***REMOVED***='defined-in docCl***REMOVED***'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-method-destroy' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Ext.Base-method-destroy' cl***REMOVED***='name expandable'>destroy</a>( <span cl***REMOVED***='pre'></span> )<st