  // My.cool.Cl***REMOVED***.method2 = function() { ... };\n});\n</code></pre>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>members</span> : <a href=\"#!/api/Object\" rel=\"Object\" cl***REMOVED***=\"docCl***REMOVED***\">Object</a><div cl***REMOVED***='sub-desc'>\n</div></li></ul><h3 cl***REMOVED***='pa'>Returns</h3><ul><li><span cl***REMOVED***='pre'><a href=\"#!/api/Ext.Base\" rel=\"Ext.Base\" cl***REMOVED***=\"docCl***REMOVED***\">Ext.Base</a></span><div cl***REMOVED***='sub-desc'><p>this</p>\n</div></li></ul></div></div></div><div id='static-method-addXtype' cl***REMOVED***='member  inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' cl***REMOVED***='defined-in docCl***REMOVED***'>Ext.Base</a><br/><a href='source/Base.html#Ext-Base-static-method-addXtype' target='_blank' cl***REMOVED***='view-source'>view source</a></div><a href='#!/api/Ext.Base-static-method-addXtype' cl***REMOVED***='name expandable'>addXtype</a>( <span cl***REMOVED***='pre'><a href=\"#!/api/Object\" rel=\"Object\" cl***REMOVED***=\"docCl***REMOVED***\">Object</a> xtype</span> )<strong cl***REMOVED***='private signature'>private</strong><strong cl***REMOVED***='static signature'>static</strong></div><div cl***REMOVED***='description'><div cl***REMOVED***='short'> ...</div><div cl***REMOVED***='long'>\n<h3 cl***REMOVED***=\"pa\">Parameters</h3><ul><li><span cl***REMOVED***='pre'>xtype</span> : <a href=\"#!/api/Object\" rel=\"Object\" cl***REMOVED***=\"docCl***REMOVED***\">Object</a><div cl***REMOVED***='sub-desc'>\n</div></li></ul></div></div></div><div id='static-method-borrow' cl***REMOVED***='member  inherited'><a href='#' cl***REMOVED***='side expandable'><span>&nbsp;</span></a><div cl***REMOVED***='title'><div cl***REMOVED***='meta'><a href='#!/api/Ext.Base' rel='Ext.Base' cl***REMOVED***='defined-in docCl***REMOVED***'>Ext.Base</a>